  \"2015-09-01T18:23:24.852955\",\n\t\"name\": \"rural-urban-continuum-codes\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The 2013 Rural-Urban Continuum Codes form
  a classification scheme that distinguishes metropolitan counties by the population
  size of their metro area, and nonmetropolitan counties by degree of urbanization
  and adjacency to a metro area. rnrnThe official Office of Management and Budget
  (OMB) metro and nonmetro categories have been subdivided into three metro and six
  nonmetro categories. Each county in the U.S. is assigned one of the 9 codes. This
  scheme allows researchers to break county data into finer residential groups, beyond
  metro and nonmetro, particularly for the analysis of trends in nonmetro areas that
  are related to population density and metro influence. The Rural-Urban Continuum
  Codes were originally developed in 1974. They have been updated each decennial since
  (1983, 1993, 2003, 2013), and slightly revised in 1988. Note that the 2013 Rural-Urban
  Continuum Codes are not directly comparable with the codes prior to 2000 because
  of the new methodology used in developing the 2000 metropolitan areas. See the Documentation
  for details and a map of the codes.rn rnAn update of the Rural-Urban Continuum Codes
  is planned for mid-2023.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
